import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/BlogPage.css';

function BlogPage() {
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    navigate('/submitted-codes');
  };

  return (
    <div className="blog-container">
      <div className="title">
        <h1>Submit</h1>
        <h1>Your</h1>
        <h1>Code</h1>
      </div>
      <form className="form-container" onSubmit={handleSubmit}>
        <input type="text" placeholder="Title" className="input-title" />
        <textarea placeholder="Code" className="input-code"></textarea>
        <button type="submit" className="submit-button">Submit</button>
      </form>
      <div className="code-animation-container">
        <div className="code-animation">const exampleCode = "This is an example of floating code";</div>
        <div className="code-animation">console.log("Another line of code moving around");</div>
        <div className="code-animation">function displayCode() {"{"} return "More floating code"; {"}"}</div>
      </div>
    </div>
  );
}

export default BlogPage;
